import { useLocation } from "react-router-dom";
import useTotalPros from "../hooks/useTotalPros";

const CompanyPage = () => {
  const location = useLocation();
  const urlReqCompanyName = location.state["companyName"];
  const totalPros1 = useTotalPros(urlReqCompanyName, "pros1");

  return (
    <div>
      <h3>urlRequest:{urlReqCompanyName}</h3>
      <h3>pros1의 합계 : {totalPros1}</h3>
      {/* <h3>commute의 평균 : {b}</h3> */}
    </div>
  );
};

export default CompanyPage;
